import React from "react";
import {CardGroup, CardBody, CardTitle, Card, Table, FormGroup, Label, Input} from "reactstrap";

const card = (workout) => {
    return (
        <Card style={{textAlign: 'center', }}>
            <CardTitle>{workout.name}</CardTitle>
            <CardBody>
                <Table>
                    <thead>
                    <tr>
                        <th>Exercise</th>
                        <th>Reps</th>
                        <th>Sets</th>
                        <th>Achieved</th>
                    </tr>
                    </thead>
                    <tbody>
                    {workout.exercises.map(e =>
                        <tr>
                            <td>{e.name}</td>
                            <td>{e.reps}</td>
                            <td>{e.sets}</td>
                            <td>ee</td>
                            {/*<FormGroup check>
                                    <Label check>
                                        <Input type="checkbox">Achieved</Input>
                                    </Label>
                                </FormGroup>*/}
                        </tr>)}
                    </tbody>

                </Table>

            </CardBody>
        </Card>
    )

}


const WorkoutWeekTable = ({workouts}) => {
    return (
        <CardGroup>
            {workouts.map(workout => card(workout))}
        </CardGroup>
    )
};

export default WorkoutWeekTable;
